import React from 'react';
import './App.css';
import Index from './components/Index.js'

function App() {
  return (
    <div className="grid-container"> 
    <div className="Header"><h1 className="hellopokemons"><span className="first">"HELLO,</span><span className="second"> POKEMONS"</span></h1></div>
      <Index />
    </div>
  );
}

export default App;
